/****** DEFINITION OF LIBRARIES CLASS INSTANCES*****/
EasyUltrasonic ultrasonic; // Create the ultrasonic object
MIDI_CREATE_DEFAULT_INSTANCE(); // Create the default MIDI instance

void setup(void)
{
    // put your setup code here, to run once:
    Serial.begin(9600); // Initialize serial communication

    pinMode(ultrasonic_HC_SR04_Echo_PIN_D17, INPUT);
    pinMode(pot1_Potentiometer_Vout_PIN_D4, INPUT);
    pinMode(pot2_Potentiometer_Vout_PIN_D13, INPUT);
    pinMode(pot3_Potentiometer_Vout_PIN_D14, INPUT);

    pinMode(ultrasonic_HC_SR04_Trigger_PIN_D16, OUTPUT);
    pinMode(LED_PIN, OUTPUT); // Initialize LED pin as output

    // Attach the ultrasonic sensor to the specified pins
    ultrasonic.attach(ultrasonic_HC_SR04_Trigger_PIN_D16, ultrasonic_HC_SR04_Echo_PIN_D17);

    // Initialize MIDI communication
    MIDI.begin();
}

void loop(void)
{
    // put your main code here, to run repeatedly:
    updateOutputs(); // Refresh output data

    // Read the distance in centimeters
    float distanceCM = ultrasonic.getDistanceCM();

    // Print the distance value to Serial Monitor
    Serial.print("Distance in CM: ");
    Serial.println(distanceCM);

    // Send MIDI message based on the distance
    if (distanceCM >= 5 && distanceCM <= 40) {
        MIDI.sendControlChange(1, map(distanceCM, 5, 40, 0, 127), 1);
    }

    // Read potentiometer values and send MIDI messages
    int pot1Value = analogRead(pot1_Potentiometer_Vout_PIN_D4);
    int pot2Value = analogRead(pot2_Potentiometer_Vout_PIN_D13);
    int pot3Value = analogRead(pot3_Potentiometer_Vout_PIN_D14);

    MIDI.sendControlChange(2, map(pot1Value, 0, 4095, 0, 127), 1);
    MIDI.sendControlChange(3, map(pot2Value, 0, 4095, 0, 127), 1);
    MIDI.sendControlChange(4, map(pot3Value, 0, 4095, 0, 127), 1);

    // Check for MIDI messages
    if (MIDI.read() && MIDI.getType() == midi::ProgramChange) {
        BlinkLed(MIDI.getData1());
    }

    delay(1000); // Delay for 1 second
}

void updateOutputs()
{
    digitalWrite(ultrasonic_HC_SR04_Trigger_PIN_D16, ultrasonic_HC_SR04_Trigger_PIN_D16_rawData);
}

void BlinkLed(byte num) {
    for (byte i = 0; i < num; i++) {
        digitalWrite(LED_PIN, HIGH);
        delay(50);
        digitalWrite(LED_PIN, LOW);
        delay(50);
    }
}

