class Solution:
    def isNStraightHand(self, hand: List[int], groupSize: int) -> bool:
        if len(hand) % groupSize != 0:
            return False
        freqMap = Counter(hand)
        hand.sort()
        for num in hand:
            if freqMap[num] <= 0:
                continue
            for k in range(groupSize):
                cur_num = num+k
                if cur_num not in freqMap or freqMap[cur_num] <= 0:
                    return False
                freqMap[cur_num] -= 1
        return True


class Solution:
    def isNStraightHand(self, hand: List[int], groupSize: int) -> bool:
        pac = len(hand)
        if pac % groupSize != 0:
            return False
        freqMap = Counter(hand)
        hand.sort()
        for num in hand:
            if not freqMap[num]:
                continue
            for k in range(groupSize):
                cur_num = num+k
                if cur_num not in freqMap:
                    return False
                freqMap[cur_num] -= 1
        return True
